import React  from "react";
import { useQuill } from 'react-quilljs';
import 'quill/dist/quill.snow.css'; 
function Edit(){
    const { quill, quillRef } = useQuill();
    return(
        <div>
            <div style={{ width: 500, height: 300 }}>
                <div ref={quillRef} />
            </div>
        </div>
    )
    
}
export default Edit;
